import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';

const ActionDetail = () => {
  const { id } = useParams();
  const [action, setAction] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simulation de données - à remplacer par un appel API
    const fetchAction = () => {
      const actions = {
        1: {
          id: 1,
          title: 'Journée de nettoyage',
          description: 'Une journée de nettoyage des espaces verts du campus.',
          startDate: '2024-09-15',
          endDate: '2024-09-15',
          status: 'planned',
          target: 'Étudiants, Personnel',
          actors: 'Équipe RSE, Bénévoles',
          resources: 'Sacs poubelles, gants, matériel de sécurité',
          kpis: ['Nombre de participants', 'Kilos de déchets collectés'],
          materials: ['Flyer', 'Présentation']
        }
      };
      
      setAction(actions[id] || null);
      setLoading(false);
    };

    fetchAction();
  }, [id]);

  if (loading) return <div>Chargement...</div>;
  if (!action) return <div>Action non trouvée</div>;

  return (
    <div className="action-detail">
      <Link to="/actions" className="back-link">← Retour aux actions</Link>
      
      <div className="action-header">
        <h1>{action.title}</h1>
        <span className={`status-badge ${action.status}`}>
          {action.status === 'planned' ? 'Planifiée' : 
           action.status === 'in-progress' ? 'En cours' : 'Terminée'}
        </span>
      </div>

      <p className="action-description">{action.description}</p>

      <div className="action-info-grid">
        <div className="info-card">
          <h3>Dates</h3>
          <p>Du {action.startDate} au {action.endDate}</p>
        </div>

        <div className="info-card">
          <h3>Population cible</h3>
          <p>{action.target}</p>
        </div>

        <div className="info-card">
          <h3>Acteurs impliqués</h3>
          <p>{action.actors}</p>
        </div>

        <div className="info-card">
          <h3>Ressources nécessaires</h3>
          <p>{action.resources}</p>
        </div>
      </div>

      <div className="kpi-section">
        <h2>Indicateurs de performance (KPI)</h2>
        <ul>
          {action.kpis.map((kpi, index) => (
            <li key={index}>{kpi}</li>
          ))}
        </ul>
      </div>

      <div className="materials-section">
        <h2>Matériel de sensibilisation</h2>
        <div className="materials-list">
          {action.materials.map((material, index) => (
            <div key={index} className="material-item">
              <span>{material}</span>
              <button className="download-btn">Télécharger</button>
            </div>
          ))}
        </div>
      </div>

      <div className="action-actions">
        <Link to={`/edit-action/${action.id}`} className="btn btn-primary">Modifier</Link>
        <button className="btn btn-secondary">Exporter</button>
      </div>
    </div>
  );
};

export default ActionDetail;
